import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
    return (
        <div>
            <h1>Home Page</h1>
            <p> Welcome to Home Page!</p>
            <p>
                Go to <Link to='/login'>Login</Link>
            </p>
            <p>
                Don't you have an account? <Link to="/signup">Signup</Link>
            </p>            
        </div>
    );
};
export default Home;
